import React from 'react';

const Forecast = (props) => {
    props.forecast.map((day) => {
        return(
            <div>
                <p>{day.summary}</p>
                <p>High of {day.tempHigh}</p>
                <p>Low of {day.tempLow}</p>
                <p>{day.precipProb} of {day.precipType}</p>
            </div>
        )
    })
}



export default Forecast;
